(e: BaseSyntheticEvent<KeyboardEvent, HTMLDivElement, HTMLButtonElement>) => {
    if (e.target?.classList.contains("o-ui-tag-remove-button")) {
        if (e.nativeEvent.key === " " || e.nativeEvent.key === "Enter") {
            e.preventDefault();
            handleRemove(e);
        }
    } else {
        // eslint-disable-next-line @typescript-eslint/ban-ts-comment
        // @ts-ignore
        triggerProps.onKeyDown(e);
    }
}

